\u0040\u0036\u0050\u003e\u0057\u0075\u002c\u002a\u0044\u0076\u004c\u0030\u002f\u003a\u0036\u0062\u0076\u003e\u0079\u004c\u0045\u0055\u0072\u002a\u0044\u0076\u004c\u0030\u002f\u003a\u0036\u0062\u0076\u005d\u0069\u006e\u0045\u0055\u0072\u003c\u0077\u0063\u0053\u0045\u002a\u0063\u004e\u0023\u0052\u0034\u006f\u0037\u006d\u007c\u0063\u003d\u0044\u0076\u004c\u0030\u002f\u003c\u003b\u002b\u0062\u0036\u0050\u003e\u0057\u007c\u005a\u002a\u004c\u0072\u0041\u0067\u005e\u0030\u0038\u0056\u004c\u0064\u002a\u0037\u0040\u0063\u0037\u0044\u0071\u0025\u0021\u003c\u0074\u002a\u0071\u0063\u007c\u0036\u0050\u003e\u0057\u0075\u002c\u002a\u0044\u0076\u004c\u0030\u002f\u003a\u0036\u0062\u0076\u002c\u0077\u0051\u0045\u0055\u0072\u0071\u0044\u0076\u004c\u0030\u002f\u0038\u006b\u0079\u0052\u0034\u006f\u002b\u0026\u0036\u0072\u007c\u0021\u0076\u0069\u0067\u0074\u004d\u0058\u002e\u0062\u0022\u003e\u0036\u0035\u002b\u006d\u0061\u0044\u0076\u004c\u0030\u002f\u0038\u006b\u0044\u004c\u0028\u006b\u0037\u0040\u0063\u0037\u002e\u0044\u0022\u0043\u0038\u003d\u0039\u0071\u0074\u007e\u004f\u0077\u0023\u0043\u0071\u0042\u004a\u0060\u006e\u0021\u0059\u0054\u0071\u0055\u0064\u0049\u0036\u0050\u003e\u0057\u0075\u002c\u006e\u0077\u006c\u0072\u0037\u0064\u0066\u002c\u0022\u0040\u0036\u0050\u003e\u0057\u0075\u002c\u002a\u0044\u0076\u004c\u0030\u002f\u003a\u0036\u0062\u0076\u002c\u0077\u006e\u0045\u0055\u0072\u0050\u0059\u006e\u0055\u0073\u0068\u007a\u0066\u0065\u0043\u0073\u0054\u0030\u0038\u0060\u0076\u005e\u0067\u004f\u0040\u0063\u0037\u002e\u0044\u0029\u0022\u005d\u0068\u0021\u0079\u0067\u007e\u0045\u0029\u0043\u007e\u007d\u0068\u005f\u0069\u0063\u0053\u0045\u002a\u0069\u0062\u0075\u0062\u0036\u0050\u003e\u0057\u0072\u005b\u0038\u0037\u002a\u0072\u0037\u0064\u0031\u004f\u002b\u005d\u0058\u004b\u0037\u0040\u0063\u0037\u006e\u0078\u0050\u0061\u0039\u0052\u0059\u0047\u002b\u0076\u0047\u003e\u0051\u0045\u0031\u0048\u0073\u0026\u0039\u0029\u0039\u0046\u006c\u002b\u0022\u0078\u004f\u0077\u0023\u0043\u0071\u0042\u004a\u0060\u004d\u0041\u003c\u0054\u005b\u007b\u0056\u006a\u003c\u0023\u007a\u0035\u005e\u0048\u006c\u004b\u004a\u003e\u0063\u0037\u0022\u0074\u005f\u005b\u0049\u005e\u0038\u003d\u004b\u004f\u0032\u0071\u006c\u007b\u005f\u0032\u0063\u004d\u0030\u0052\u0060\u003e\u0050\u0023\u0073\u0068\u007a\u0066\u006f\u0021\u0044\u003d\u0028\u0071\u0074\u007e\u0060\u006e\u006e\u0055\u0073\u0068\u007a\u0066\u006f\u0021\u0076\u0068\u0064\u0068\u0060\u0076\u0028\u006b\u007e\u0051\u006a\u004f\u0032\u0071\u003d\u004c\u0078\u0068\u0074\u0060\u005e\u004c\u0038\u004f\u005a\u006f\u0073\u0068\u007a\u0066\u002c\u003e\u0049\u0057\u0074\u0045\u003e\u007e\u0035\u0069\u003f\u0055\u0073\u0068\u007a\u0066\u006f\u0021\u004d\u0067\u0069\u0071\u007d\u0076\u006f\u004b\u0037\u0040\u0063\u0037\u002e\u0044\u0039\u0029\u0029\u0033\u0067\u0046\u0023\u0052\u0034\u006f\u006b\u0043\u0041\u005b\u0038\u0026\u0058\u0039\u0066\u0054\u0067\u0046\u0064\u0049\u0036\u0050\u003e\u0057\u0075\u002c\u006e\u0077\u006c\u0072\u0037\u0064\u0066\u002c\u0022\u0040\u0036\u0050\u003e\u0057\u0032\u005b\u0021\u0060\u003c\u0029\u007c\u0067\u0021\u0079\u0075\u0040\u0036\u0050\u003e\u0057\u0075\u002c\u007c\u0060\u0026\u0021\u0038\u003d\u0021\u0079\u0067\u007e\u0045\u0029\u0043\u007e\u007d\u0068\u005f\u0069\u0063\u0053\u0045\u002a\u0063\u004e\u0023\u0052\u0034\u006f\u0037\u006d\u007c\u0063\u003d\u0044\u0076\u004c\u0030\u002f\u0062\u0038\u0022\u0040\u0036\u0050\u003e\u0057\u0075\u002c\u0032\u0052\u0032\u007b\u0049\u0057\u0074\u0045\u0023\u0040\u0071\u004b\u0077\u0073\u005e\u0048\u005d\u006c\u006a\u0029\u0039\u0046\u006c\u002b\u006a\u004a\u0042\u0028\u004c\u0045\u0031\u0048\u0060\u006c\u002a\u0072\u0037\u0064\u0069\u0074\u0062\u0076\u0026\u0028\u0039\u0045\u005a\u007d\u006c\u006f\u004f\u003e\u002e\u0037\u007d\u005f\u0031\u004d\u0064\u002a\u003f\u007e\u0065\u0037\u0065\u0071\u0032\u004a\u0062\u0057\u0074\u0045\u003e\u007e\u002c\u0055\u0050\u0023\u0073\u0068\u007a\u0066\u007c\u003e\u0049\u0057\u0074\u0045\u003e\u007e\u0035\u0069\u003f\u0055\u0073\u0068\u007a\u0066\u006f\u0021\u004d\u0067\u0069\u0071\u007d\u0076\u006f\u004b\u0037\u0040\u0063\u0037\u002e\u0044\u0039\u0029\u0029\u0033\u0067\u0046\u0023\u0052\u0034\u006f\u006b\u0043\u0041\u005b\u0038\u0026\u0029\u0041\u002b\u0054\u002e\u006b\u004f\u0044\u0073\u003e\u0032\u006d\u0039\u004f\u0032\u0071\u002a\u0061\u0063\u0037\u006f\u0068\u005f\u005b\u0049\u005e\u0031\u004e\u0031\u0048\u0073\u0026\u002a\u0072\u0037\u0064\u0053\u0045\u0024\u004d\u0070\u0023\u0054\u0073\u0038\u002c\u007c\u0046\u002b\u0039\u0045\u0057\u0074\u0045\u003e\u007e\u0060\u0067\u004f\u0040\u0063\u0037\u006e\u0078\u0050\u0061\u0039\u0052\u0059\u0047\u002e\u0062\u0036\u0050\u003e\u0057\u0032\u005b\u0021\u0060\u004c\u0021\u0066\u0054\u005b\u007b\u003e\u0052\u0034\u006f\u004f\u0056\u005f\u0048\u007c\u0021\u0076\u0069\u0067\u0074\u004d\u0058\u002b\u0076\u0066\u0051\u0079\u0058\u006f\u0031\u007c\u0021\u0076\u0069\u0030\u003d\u0066\u0044\u0079\u0052\u0034\u006f\u002b\u0026\u0036\u0072\u007c\u0021\u0076\u0069\u0030\u003d\u0055\u0074\u005f\u005b\u0049\u005e\u0038\u003d\u004b\u004f\u0032\u0071\u003d\u004c\u0078\u0068\u004e\u0079\u0029\u0078\u002b\u0051\u0072\u0056\u0054\u0030\u0074\u0044\u0076\u004c\u0030\u002f\u003a\u0036\u0036\u0062\u0021\u003b\u0036\u0035\u002b\u006d\u0065\u003d\u002a\u0072\u0037\u0064\u0053\u0045\u0024\u004d\u0050\u006b\u005a\u0050\u005e\u0048\u005d\u006c\u0063\u006a\u0037\u0064\u0069\u0062\u002a\u006b\u006a\u0039\u0022\u0067\u007e\u0074\u003b\u007d\u002a\u0072\u0037\u0064\u0052\u0062\u0075\u007c\u005a\u0077\u0023\u0043\u0071\u0042\u006a\u006e\u004e\u004c\u0039\u0046\u006c\u002b\u0022\u0078\u0034\u0069\u0069\u0026\u004b\u004f\u0032\u0071\u006c\u007b\u005f\u0032\u0063\u0079\u0066\u0062\u0031\u006b\u0037\u0040\u0063\u0037\u002e\u0044\u0022\u0043\u0047\u003d\u003b\u0071\u0074\u007e\u006f\u004b\u0037\u0040\u0063\u0037\u0044\u0071\u0025\u0021\u0055\u0053\u0036\u002c\u0060\u0076\u004e\u002b\u002c\u006f\u0073\u0068\u007a\u0066\u006f\u0021\u0076\u0068\u0024\u0060\u0060\u0076\u0077